import React from 'react';

const Cart= ({ cartItems }) => {
  return (
    <div>
      <h1>Trang giỏ hàng</h1>
      {cartItems.length > 0 ? (
        <table>
          <thead>
            <tr>
              <th>STT</th>
              <th>Tiêu đề</th>
              {/* Thêm các cột khác tương tự */}
            </tr>
          </thead>
          <tbody>
            {cartItems.map((item, index) => (
              <tr key={item.id}>
                <td>{index + 1}</td>
                <td>{item.name}</td>
                {/* Thêm các ô khác tương tự */}
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>Giỏ hàng trống</p>
      )}
    </div>
  );
};

export default Cart;
